/*
* Adds two numbers
* @param {object} styles - csv list of styles
* @return {boolean}
*/
window.checkForPWStyles = function(styles, activate){
		var utils = window.optimizely.get("utils");
		
    function waitForNewProducts() {
        return (
          (e = document.querySelectorAll(".product-card").length),
            utils.waitUntil(function () {
                return document.querySelectorAll(".product-card").length > e;
            })
        );
    }
		
    function searchForStyles() {
        var product_cards = document.querySelectorAll(".product-card");
        var product_cards_array = Array.from(product_cards);
        var hasStyle = product_cards_array.some(function (item) {
            var t =
              item.querySelector(".product-card__link-overlay") || item.querySelector(".product-card__img-link-overlay");
            if (t.href) {
                var r = t.href.split("/");
								var g = styles[0].includes('-') ? r[r.length - 1] : r[r.length - 1].split("-")[0];
                if (styles.includes(g)) {
                    return true;
                }
            }
        });
        if (hasStyle) {
            activate();
        } else {
            waitForNewProducts().then(searchForStyles);
        }
    }
		
		utils.waitForElement('.product-card').then(searchForStyles);
};
